import{c as a}from"./app.7fbe9127.js";import{_ as p}from"./plugin-vue_export-helper.21dcd24c.js";const r={},t=a('<h1 id="\u5E8F" tabindex="-1"><a class="header-anchor" href="#\u5E8F" aria-hidden="true">#</a> \u5E8F</h1><p>\u6B22\u8FCE\u9605\u8BFB\u5E7F\u53D7\u597D\u8BC4\u7684 \u300A\u4F60\u4E0D\u77E5\u9053\u7684JavaScript\u300B (<code>You Don&#39;t Know JS</code> , <strong>YDKJS</strong>) \u7CFB\u5217\u4E1B\u4E66\u7684\u7B2C\u4E8C\u7248\uFF1A\u300A\u4F60<strong>\u8FD8</strong>\u4E0D\u77E5\u9053\u7684JavaScript\u300B (<code>You Don&#39;t Know JS Yet</code> , <strong>YDKJSY</strong>) \u3002</p><p>\u5982\u679C\u4F60\u8BFB\u8FC7\u7B2C\u4E00\u7248\u7684\u4EFB\u4F55\u4E00\u672C\u4E66\uFF0C\u4F60\u53EF\u4EE5\u5728\u8FD9\u4E00\u7248\u7684\u4E66\u4E2D\u627E\u5230\u5168\u65B0\u7684\u3001\u5927\u91CF\u7684\u3001\u66F4\u65B0\u4E86\u8FC7\u53BB\u4E94\u5E74\u4E2D JavaScript \u53D8\u5316\u7684\u5185\u5BB9\u3002\u4F46\u6211\u5E0C\u671B\u5E76\u76F8\u4FE1\u4F60\u4ECD\u7136\u4F1A\u611F\u89C9\u5230\u8FD9\u4E00\u7248\u4E66\u7C4D\u540C\u6837\u5730\u5C0A\u91CD JavaScript \u5E76\u6DF1\u5165\u7814\u7A76\u771F\u6B63\u8BA9\u5B83\u95EA\u95EA\u53D1\u5149\u7684\u4E1C\u897F\u3002</p><p>\u5982\u679C\u8FD9\u662F\u4F60\u7B2C\u4E00\u6B21\u9605\u8BFB\u672C\u7CFB\u5217\u4E1B\u4E66\uFF0C\u90A3\u6211\u975E\u5E38\u9AD8\u5174\u4F60\u9009\u62E9\u4E86\u5B83\u3002\u51C6\u5907\u597D\u5F00\u59CB\u4E00\u4E2A\u6DF1\u5165\u7684\u3001\u5E7F\u6CDB\u7684\u3001\u63A2\u5BFBJavaScript\u6BCF\u4E00\u4E2A\u89D2\u843D\u7684\u65C5\u7A0B\u5427\u3002</p><p>\u5982\u679C\u4F60\u53EA\u662F\u521A\u5F00\u59CB\u5B66\u4E60\u7F16\u7A0B\u6216\u5B66\u4E60JavaScript\uFF0C\u8BF7\u6CE8\u610F\uFF0C\u8FD9\u5E76\u4E0D\u662F\u4E00\u4E2A \u201CJavaScript\u5165\u95E8\u6559\u7A0B\u201D \u3002\u6709\u65F6\uFF0C\u4E66\u4E2D\u7684\u5185\u5BB9\u662F\u65E2\u590D\u6742\u800C\u53C8\u5177\u6311\u6218\u6027\u7684\uFF0C\u800C\u4E14\u6BD4\u4E00\u4E2A\u521D\u5B66\u8005\u6240\u5E94\u5F53\u5B66\u4E60\u7684\u5185\u5BB9\u6DF1\u5165\u5F97\u591A\u3002\u65E0\u8BBA\u4F60\u7684\u80CC\u666F\u5982\u4F55\uFF0C\u90FD\u6B22\u8FCE\u9605\u8BFB\u672C\u4E1B\u4E66\uFF0C\u53EA\u662F\u4F60\u8981\u610F\u8BC6\u5230\uFF0C\u8FD9\u4E9B\u5185\u5BB9\u662F\u5728\u5047\u5B9A\u4F60\u5DF2\u7ECF\u719F\u6089JavaScript\u5E76\u4E14\u81F3\u5C11\u62E5\u67096-9\u4E2A\u6708\u7684\u5F00\u53D1\u7ECF\u9A8C\u4E0B\u7F16\u5199\u7684\u3002</p><h2 id="\u5173\u4E8E\u672C\u4E66\u6240\u8BA8\u8BBA\u7684\u90E8\u5206" tabindex="-1"><a class="header-anchor" href="#\u5173\u4E8E\u672C\u4E66\u6240\u8BA8\u8BBA\u7684\u90E8\u5206" aria-hidden="true">#</a> \u5173\u4E8E\u672C\u4E66\u6240\u8BA8\u8BBA\u7684\u90E8\u5206</h2><p>\u8FD9\u672C\u4E66\u5BF9\u5F85JavaScript\u7684\u6001\u5EA6\u523B\u610F\u5730\u4E0E \u201C\u53EA\u5F3A\u8C03\u597D\u7684\u90E8\u5206\u662F\u600E\u6837\u5F97\u597D\u201D \u76F8\u53CD\uFF0C\u5F53\u7136\uFF0C\u8FD9\u4E5F\u5E76\u4E0D\u662F\u8BF4\u6211\u4EEC\u53EA\u7814\u7A76\u574F\u7684\u90E8\u5206\uFF0C\u800C\u662F\u8BA4\u771F\u5730\u63A2\u7D22<strong>\u6BCF\u4E00\u90E8\u5206</strong>\u3002</p><p>\u4F60\u53EF\u80FD\u66FE\u7ECF\u542C\u8BF4\uFF0C\u6216\u8005\u81EA\u5DF1\u611F\u89C9\uFF0CJavaScript\u662F\u4E00\u95E8\u5F88\u70C2\u7684\u8BED\u8A00\uFF0C\u4ED6\u7684\u8BBE\u8BA1\u6BEB\u65E0\u4EAE\u70B9\uFF0C\u8BED\u8A00\u7684\u5B9E\u73B0\u4E5F\u53C2\u5DEE\u4E0D\u9F50\u3002\u8BB8\u591A\u4EBA\u751A\u81F3\u65AD\u8A00JavaScript\u662F\u5168\u4E16\u754C\u6D41\u884C\u7684\u8BED\u8A00\u4E2D\u6700\u7CDF\u7CD5\u7684\uFF1B\u6CA1\u6709\u4EBA\u4F1A\u56E0\u4E3A\u5BF9\u8FD9\u95E8\u8BED\u8A00\u7684\u70ED\u6795\u800C\u53BB\u7528\u5B83\u5199\u4EE3\u7801\uFF0C\u7F16\u5199\u5B83\u53EA\u662F\u56E0\u4E3A\u4ED6\u4EEC\u60F3\u5728\u4E92\u8054\u7F51\u7684\u4E2D\u5FC3\u5360\u636E\u4E00\u5E2D\u4E4B\u5730\u3002\u8FD9\u662F\u4E00\u4E2A\u8352\u8C2C\u3001\u4E0D\u5065\u5EB7\u4E14\u5B8C\u5168\u5C45\u9AD8\u4E34\u4E0B\u7684\u770B\u6CD5\u3002</p><p>\u5176\u5B9E\uFF0C\u6BCF\u5929\u90FD\u6709\u6570\u767E\u4E07\u7684\u5F00\u53D1\u4EBA\u5458\u7F16\u5199 JavaScript\uFF0C\u5176\u4E2D\u8BB8\u591A\u4EBA\u6B23\u8D4F\u5E76\u5C0A\u91CD\u8FD9\u95E8\u8BED\u8A00\u3002</p><p>\u5C31\u50CF\u5176\u4ED6\u975E\u5E38\u4F18\u79C0\u7684\u7F16\u7A0B\u8BED\u8A00\u4E00\u6837\uFF0C\u5B83\u6709\u4EE4\u5B83\u95EA\u4EAE\u7684\u4F18\u70B9\uFF0C\u4E5F\u6709\u81F4\u547D\u7684\u7F3A\u9677\u3002\u5373\u4F7F\u662FJavaScript\u7684\u521B\u9020\u8005\u5E03\u5170\u767B\xB7\u827E\u5947(<strong>Brendan Eich</strong>)\uFF0C\u4E5F\u611F\u53F9JavaScript\u7684\u6709\u4E9B\u90E8\u5206\u662F\u9519\u8BEF\u7684\u3002\u4F46\u4ED6\u4E5F\u9519\u4E86\uFF1A\u5B83\u4EEC\u6839\u672C\u5C31\u4E0D\u662F\u9519\u8BEF\u3002JavaScript\u80FD\u6210\u4E3A\u4ECA\u5929\u7684\u8FD9\u4E2A\u6837\u5B50\u2014\u2014\u4E16\u754C\u4E0A\u6700\u6D41\u884C\uFF0C\u4E14\u6700\u5177\u5F71\u54CD\u529B\u7684\u7F16\u7A0B\u8BED\u8A00\u4E4B\u4E00\u2014\u2014\u5C31\u662F\u56E0\u4E3A<strong>\u6240\u6709\u7684\u8FD9\u4E9B\u90E8\u5206</strong></p><p>\u4E0D\u8981\u76F8\u4FE1\u90A3\u4E9B\u8BF4\u4F60\u5E94\u8BE5\u53EA\u5B66\u4E60\u548C\u4F7F\u7528\u4E00\u5C0F\u64AE\u597D\u7684\u90E8\u5206\u800C\u907F\u514D\u6240\u6709\u574F\u7684\u4E1C\u897F\u7684\u8C0E\u8A00\u3002\u4E0D\u8981\u76F8\u4FE1\u50CF \u201CX\u662F\u66F4\u65B0\u7684Y\u201D \u8FD9\u6837\u7684\uFF0C\u62FF\u7740\u65B0\u7684\u8BED\u8A00\u529F\u80FD\uFF0C\u5C06\u4F7F\u7528\u65E7\u7684\u8BED\u8A00\u529F\u80FD\u7684\u884C\u4E3A\u5F52\u4E3A\u8FC7\u65F6\u548C\u65E0\u77E5\u7684\u8A00\u8BBA\u3002\u66F4\u4E0D\u8981\u76F8\u4FE1\u90A3\u4E9B\u56E0\u4E3A\u4F60\u6CA1\u6709\u4F7F\u7528\u51E0\u5468\u524D\u624D\u521A\u63D0\u51FA\u7684\u3001\u521A\u521A\u5F00\u59CB\u5F00\u53D1\u7684\u8BED\u8A00\u7279\u5F81\u800C\u8BF4\u4F60\u7684\u4EE3\u7801\u4E0D\u591F \u201C\u73B0\u4EE3\u201D \u7684\u4EBA\u3002</p><p>JavaScript\u7684\u6BCF\u4E00\u90E8\u5206\u90FD\u662F\u6709\u7528\u7684\u3002\u53EA\u662F\u6709\u4E9B\u90E8\u5206\u6BD4\u5176\u4ED6\u90E8\u5206\u66F4\u52A0\u5F3A\u5927\uFF0C\u6709\u4E9B\u90E8\u5206\u4F7F\u7528\u65F6\u9700\u8981\u66F4\u591A\u7684\u4E13\u6CE8\u548C\u8C28\u614E\u800C\u5DF2\u3002</p><p>\u6211\u53D1\u73B0\uFF0C\u53EA\u4F7F\u7528JavaScript\u7684\u4E00\u5C0F\u90E8\u5206\u800C\u6210\u4E3A\u4E00\u4E2A\u771F\u6B63\u7684JavaScript\u9AD8\u624B\u662F\u4E00\u4EF6\u8352\u8C2C\u7684\u4E8B\u60C5\u3002\u4F60\u80FD\u60F3\u8C61\u4E00\u4E2A\u5DE5\u5177\u7BB1\u91CC\u88C5\u6EE1\u5DE5\u5177\u7684\u5EFA\u7B51\u5DE5\u4EBA\uFF0C\u4ED6\u53EA\u4F1A\u7528\u9524\u5B50\u800C\u5632\u7B11\u87BA\u4E1D\u5200\u6216\u5377\u5C3A\u662F\u5783\u573E\u5417\uFF1F\u8FD9\u53EA\u4F1A\u8BA9\u4EBA\u89C9\u5F97\u5F88\u611A\u8822\u3002</p><p>\u6211\u53D1\u81EA\u5185\u5FC3\u7684\u770B\u6CD5\u662F\uFF0C\u4F60\u5E94\u8BE5\u53BB\u5B66\u4E60 JavaScript \u7684\u6240\u6709\u90E8\u5206\uFF0C\u5E76\u5728\u5408\u9002\u7684\u65F6\u5019\u4F7F\u7528\u5B83\u4EEC\uFF01\u5982\u679C\u53EF\u4EE5\u7684\u8BDD\uFF0C\u6211\u751A\u81F3\u4F1A\u5927\u80C6\u5730\u5EFA\u8BAE\uFF1A\u662F\u65F6\u5019\u629B\u5F03\u4EFB\u4F55\u544A\u8BC9\u4F60\u5176\u4ED6\u770B\u6CD5\u7684JavaScript\u4E66\u7C4D\u4E86\u3002</p><h2 id="\u5173\u4E8E\u6807\u9898" tabindex="-1"><a class="header-anchor" href="#\u5173\u4E8E\u6807\u9898" aria-hidden="true">#</a> \u5173\u4E8E\u6807\u9898...\uFF1F</h2><p>\u6240\u4EE5\u8FD9\u4E2A\u6807\u9898\u5230\u5E95\u60F3\u8BF4\u4EC0\u4E48\uFF1F</p><p>\u6211\u5E76\u4E0D\u662F\u60F3\u8981\u9A82\u4F60\u5BF9JavaScript\u7F3A\u4E4F\u4E86\u89E3\uFF0C\u6211\u5E76\u4E0D\u662F\u8BF4\u4F60\u73B0\u5728\u548C\u5C06\u6765\u4E0D\u80FD\u5B66\u4E60JavaScript\uFF0C\u6211\u4E5F\u5E76\u4E0D\u662F\u5728\u5439\u5618\u6211\u6709\u7740\u53EA\u6709\u5C11\u6570\u4EBA\u6709\u7684\u9AD8\u660E\u89C1\u89E3\u3002</p><p>\u8BF4\u5B9E\u8BDD\uFF0C\u5728\u4EBA\u4EEC\u9605\u8BFB\u4E66\u7C4D\u4E4B\u524D\uFF0C\u6240\u6709\u8FD9\u4E9B\u90FD\u662F\u7B2C\u4E00\u773C\u770B\u5230\u8FD9\u4E2A\u6807\u9898\u7684\u771F\u5B9E\u53CD\u5E94\uFF0C\u800C\u8FD9\u5176\u5B9E\u662F\u6BEB\u65E0\u6839\u636E\u7684\u3002</p><p>\u201C\u4F60\u8FD8\u4E0D\u77E5\u9053\u7684JavaScript\u201D \u8FD9\u4E00\u6807\u9898\u7684\u51FA\u53D1\u70B9\u662F\u70B9\u660E\u5927\u591A\u6570JavaScript\u5F00\u53D1\u8005\u5E76\u6CA1\u6709\u4E0B\u529F\u592B\u53BB\u771F\u6B63\u7406\u89E3\u4ED6\u4EEC\u7F16\u5199\u7684\u4EE3\u7801\u662F\u5982\u4F55\u5DE5\u4F5C\u7684\u3002\u4ED6\u4EEC\u77E5\u9053\u5B83\u6B63\u5E38\u5DE5\u4F5C\u4E86\u2014\u2014\u5B83\u4EA7\u751F\u4E86\u671F\u671B\u7684\u7ED3\u679C\u3002\u4F46\u5B83\u4EEC\u8981\u4E48\u4E0D\u771F\u6B63\u7406\u89E3\u4E3A\u4EC0\u4E48\uFF0C\u8981\u4E48\u66F4\u7CDF\u7CD5\u5730\uFF0C\u4ED6\u4EEC\u5FC3\u4E2D\u5B58\u5728\u7684\u662F\u4E00\u4E2A\u4E0D\u51C6\u786E\u7684\u3001\u7ECF\u4E0D\u4F4F\u63A8\u6572\u7684 \u201C\u4E3A\u4EC0\u4E48\u201D\u3002</p><p>\u6211\u73B0\u5728\u7ED9\u8BFB\u8005\u4E00\u4E2A\u6E29\u548C\u4F46\u8BA4\u771F\u7684\u6311\u6218\uFF1A\u629B\u5F00\u4F60\u5BF9JavaScript\u7684\u60F3\u8C61\uFF0C\u7528\u65B0\u9C9C\u7684\u773C\u5149\u548C\u5145\u6EE1\u6D3B\u529B\u7684\u597D\u5947\u5FC3\u6765\u8FCE\u63A5\u5B83\uFF0C\u8FD9\u4E5F\u8BA9\u4F60\u5BF9\u4F60\u5199\u7684\u6BCF\u4E00\u884C\u4EE3\u7801\u5228\u6839\u95EE\u5E95\u2014\u2014\u4E3A\u4EC0\u4E48\u5B83\u4F1A\u505A\u5B83\u505A\u7684\u4E8B\uFF1F\u4E3A\u4EC0\u4E48\u4E00\u79CD\u65B9\u6CD5\u6BD4\u4F60\u53EF\u4EE5\u5B8C\u6210\u7684\u5176\u4ED6\u516D\u79CD\u65B9\u6CD5\u66F4\u597D\u6216\u66F4\u5408\u9002\uFF1F \u4E3A\u4EC0\u4E48\u6240\u6709 \u201C\u5927\u4F6C\u201D \u90FD\u5EFA\u8BAE\u4F60\u5199 X \u4EE3\u7801\uFF0C\u4F46\u4E8B\u5B9E\u8BC1\u660E Y \u53EF\u80FD\u662F\u66F4\u597D\u7684\u9009\u62E9\uFF1F</p><p>\u6211\u5728\u539F\u6765\u7684\u6807\u9898\u4E2D\u52A0\u4E86\u4E2A \u201C\u8FD8\u201D\uFF0C\u4E0D\u4EC5\u56E0\u4E3A\u5B83\u662F\u7B2C\u4E8C\u7248\uFF0C\u800C\u4E14\u56E0\u4E3A\u6211\u5230\u5934\u6765\u8FD8\u662F\u5E0C\u671B\u8FD9\u4E9B\u4E66\u4EE5\u4E00\u79CD\u5145\u6EE1\u5E0C\u671B\u800C\u4E0D\u662F\u4EE4\u4EBA\u6CAE\u4E27\u7684\u65B9\u5F0F\u6311\u6218\u4F60\u3002</p><p>\u4F46\u6211\u9700\u8981\u660E\u786E\u4E00\u70B9\uFF1A\u6211\u4E0D\u89C9\u5F97\u6211\u4EEC\u80FD\u5B8C\u5168\u7CBE\u901AJavaScript\u3002\u8FD9\u4E0D\u662F\u8981\u8FBE\u5230\u7684\u6210\u5C31\uFF0C\u800C\u662F\u8981\u52AA\u529B\u8FFD\u6C42\u7684\u76EE\u6807\u3002\u4F60\u5E76\u6CA1\u6709\u5B8C\u5168\u4E86\u89E3JavaScript\uFF0C\u4F60\u53EA\u9700\u8981\u82B1\u66F4\u591A\u7684\u65F6\u95F4\uFF0C\u5B66\u4E60\u66F4\u591A\u6709\u5173\u8BED\u8A00\u7684\u4E1C\u897F\u3002\u4F60\u7684\u7814\u7A76\u8D8A\u6DF1\u5165\uFF0C\u4F60\u5C31\u4F1A\u8D8A\u591A\u5730\u91CD\u65B0\u5BA1\u89C6\u4F60\u4EE5\u524D\u6240\u4E86\u89E3\u7684\uFF0C\u5E76\u4ECE\u66F4\u6709\u7ECF\u9A8C\u7684\u89D2\u5EA6\u91CD\u65B0\u5B66\u4E60\u5B83\u3002</p><p>\u6211\u9F13\u52B1\u60A8\u56F4\u7ED5 JavaScript \u4EE5\u53CA\u6240\u6709\u8F6F\u4EF6\u5F00\u53D1\u6280\u672F\u91C7\u53D6\u4E00\u79CD\u601D\u7EF4\u65B9\u5F0F\uFF0C\u5373\u60A8\u6C38\u8FDC\u4E0D\u4F1A\u5B8C\u5168\u638C\u63E1\u5B83\uFF0C\u4F46\u60A8\u53EF\u4EE5\u800C\u4E14\u5E94\u8BE5\u7EE7\u7EED\u52AA\u529B\u63A5\u8FD1\u8FD9\u4E00\u76EE\u6807\uFF0C\u8FD9\u4E00\u601D\u7EF4\u53EF\u4EE5\u5EF6\u4F38\u5230\u4F60\u7684\u6574\u4E2A\u8F6F\u4EF6\u5F00\u53D1\u751F\u6DAF\uFF0C\u751A\u81F3\u66F4\u8FDC\u3002</p><p>\u4F60\u603B\u662F\u53EF\u4EE5\u6BD4\u73B0\u5728\u66F4\u4E86\u89E3JavaScript\u3002\u8FD9\u5C31\u662F\u6211\u5E0C\u671B\u672C\u4E66\u6240\u80FD\u5E26\u7ED9\u4F60\u7684\u3002</p><h2 id="\u5173\u4E8E\u672C\u4E66\u7684\u4EFB\u52A1" tabindex="-1"><a class="header-anchor" href="#\u5173\u4E8E\u672C\u4E66\u7684\u4EFB\u52A1" aria-hidden="true">#</a> \u5173\u4E8E\u672C\u4E66\u7684\u4EFB\u52A1</h2><p>\u6211\u89C9\u5F97\u8BA4\u771F\u5B66\u597DJavaScript\u662F\u4E0D\u9700\u8981\u4EC0\u4E48\u7406\u7531\u7684\u2014\u2014\u8FD9\u8FDC\u4E0D\u6B62\u56E0\u4E3A\u6211\u4EEC\u90FD\u660E\u767D\u7684\uFF0C\u5B83\u5728\u5168\u4E16\u754C\u7684\u7F16\u7A0B\u8BED\u8A00\u4E2D\u5904\u4E8E\u600E\u6837\u4E3E\u8DB3\u8F7B\u91CD\u7684\u5730\u4F4D\u3002</p><p>\u4F46\u662F\uFF0C\u5F88\u591AJavaScript\u7684\u7EC6\u8282\u548C\u8981\u70B9\u8FD8\u9700\u8981\u88AB\u544A\u4E4B\u4E8E\u4F17\uFF0C\u800C\u8FD9\u4E9B\u4E66\u7C4D\u5C31\u5E94\u8FD0\u800C\u751F\u3002</p><p>\u6211\u6559\u8FC7\u4E94\u5343\u591A\u4E2A\u5206\u5E03\u5728\u4E16\u754C\u5404\u5730\u7684\u5F00\u53D1\u8005\uFF0C\u4ED6\u4EEC\u6765\u81EA\u516D\u4E2A\u5927\u6D32\u768425\u4E2A\u56FD\u5BB6\uFF0C\u53C8\u5206\u522B\u5C5E\u4E8E\u4E0D\u540C\u7684\u56E2\u961F\u6216\u516C\u53F8\u3002\u800C\u6211\u7ECF\u5E38\u770B\u5230\u7684\u662F\uFF0C\u4ED6\u4EEC\u5F88\u591A\u65F6\u5019\u53EA\u5173\u6CE8\u7A0B\u5E8F\u7684\u7ED3\u679C\uFF0C\u800C\u4E0D\u662F\u7A0B\u5E8F\u7684\u7F16\u5199\u8FC7\u7A0B\u548C\u539F\u7406\u3002</p><p>\u6211\u4F5C\u4E3A\u4E00\u540D\u5F00\u53D1\u4EBA\u5458\u548C\u8001\u5E08\u7684\u7ECF\u9A8C\u544A\u8BC9\u6211\uFF1A\u5982\u679C\u4F60\u80FD\u66F4\u5168\u9762\u5730\u4E86\u89E3\u4F60\u7684\u4EE3\u7801\u662F\u5982\u4F55\u5DE5\u4F5C\u7684\uFF0C\u800C\u4E0D\u662F\u4EC5\u4EC5\u8BA9\u5B83\u4EA7\u751F\u9884\u671F\u7684\u7ED3\u679C\uFF0C\u90A3\u4E48\u4F60\u5728\u5F00\u53D1\u5DE5\u4F5C\u4E2D\u603B\u662F\u4F1A\u66F4\u6709\u6548\u7387\u3002</p><p>\u6362\u53E5\u8BDD\u8BF4\uFF0C\u201C\u8DB3\u4EE5\u5DE5\u4F5C\u7684\u597D\u201D \u4E0D\u662F\u8DB3\u591F\u597D\uFF0C\u4E5F\u4E0D\u5E94\u8BE5\u662F\u8DB3\u591F\u597D\u3002</p><p>\u6240\u6709\u5F00\u53D1\u4EBA\u5458\u90FD\u7ECF\u5E38\u4E3A\u67D0\u4E9B\u4EE3\u7801\u4E0D\u80FD\u6B63\u5E38\u5DE5\u4F5C\u800C\u70E6\u607C\uFF0C\u800C\u4E14\u4ED6\u4EEC\u4E5F\u4E0D\u77E5\u9053\u4E3A\u4EC0\u4E48\u3002\u4F46\u662F\u5F88\u591A\u65F6\u5019\uFF0CJavaScript\u5F00\u53D1\u8005\u53EA\u662F\u5C06\u6B64\u5F52\u548E\u4E8E\u8BED\u8A00\u672C\u8EAB\uFF0C\u800C\u4E0D\u662F\u627F\u8BA4\u8FD9\u662F\u4ED6\u4EEC\u81EA\u5DF1\u7684\u7406\u89E3\u4E0D\u8DB3\u3002\u8FD9\u4E9B\u4E66\u65E2\u662F\u95EE\u9898\uFF0C\u4E5F\u662F\u7B54\u6848\uFF1A\u4E3A\u4EC0\u4E48\u5B83\u4F1A\u4EA7\u751F\u9519\u7684\u7ED3\u679C\uFF0C\u4EE5\u53CA\u5982\u4F55\u8BA9\u5B83\u4EA7\u751F\u6B63\u786E\u7684\u7ED3\u679C\u3002</p><p>\u672C\u4E66\u7684\u4EFB\u52A1\u5C31\u662F\u8BA9\u6BCF\u4E00\u4E2AJavaScript\u5F00\u53D1\u8005\u90FD\u80FD\u5B8C\u5168\u628A\u63E1\u4ED6\u4EEC\u7F16\u5199\u7684\u4EE3\u7801\uFF0C\u7406\u89E3\u5B83\uFF0C\u5E76\u6709\u610F\u56FE\u5730\u3001\u6E05\u6670\u5730\u7F16\u5199\u65B0\u7684\u4EE3\u7801\u3002</p><h2 id="\u5173\u4E8E\u5B66\u4E60\u672C\u4E66\u7684\u65B9\u5F0F" tabindex="-1"><a class="header-anchor" href="#\u5173\u4E8E\u5B66\u4E60\u672C\u4E66\u7684\u65B9\u5F0F" aria-hidden="true">#</a> \u5173\u4E8E\u5B66\u4E60\u672C\u4E66\u7684\u65B9\u5F0F</h2><p>\u4F60\u53EF\u80FD\u5DF2\u7ECF\u62B1\u7740\u8BFB\u900F\u6240\u6709\u516D\u672C\u4E66\u7684\u76EE\u6807\uFF0C\u8F70\u8F70\u70C8\u70C8\u5730\u5F00\u59CB\u4E86\u5BF9\u672C\u4E66\u7684\u9605\u8BFB\u3002</p><p>\u5982\u679C\u771F\u7684\u8FD9\u6837\uFF0C\u6211\u60F3\u4F60\u53EF\u4EE5\u8003\u8651\u6539\u53D8\u4E00\u4E0B\u4F60\u7684\u8FD9\u4E00\u8BA1\u5212......</p><p>\u6211\u7684\u610F\u56FE\u5E76\u4E0D\u662F\u8BA9\u4F60\u628A\u672C\u4E66\u4E00\u904D\u8BFB\u5B8C\u3002\u4E66\u4E2D\u7684\u5185\u5BB9\u975E\u5E38\u5BC6\u96C6\uFF0C\u56E0\u4E3AJavaScript\u529F\u80FD\u5F3A\u5927\u3001\u5E7F\u6CDB\uFF0C\u800C\u4E14\u90E8\u5206\u5185\u5BB9\u76F8\u5F53\u590D\u6742\u3002\u6CA1\u6709\u4EBA\u80FD\u591F\u50CF\u8BA1\u7B97\u673A\u4E00\u6837\u4E00\u6B21\u6027\u628A\u4E66\u4E2D\u7684\u6240\u6709\u5185\u5BB9 \u201C\u4E0B\u8F7D\u201D \u5230\u81EA\u5DF1\u7684\u5927\u8111\u4E2D\uFF0C\u5E76\u505A\u5230\u65E2\u4E0D\u51FA\u5DEE\u9519\u4E5F\u4E0D\u9057\u6F0F\u3002\u8FD9\u662F\u4E0D\u5408\u7406\u7684\uFF0C\u662F\u611A\u8822\u7684\u5C1D\u8BD5\u3002</p><p>\u6211\u7684\u5EFA\u8BAE\u662F\u4F60\u53EA\u9700\u8981\u82B1\u4E00\u70B9\u65F6\u95F4\u6D4F\u89C8\u672C\u4E66\u3002\u62FF\u4E00\u4E2A\u7AE0\u8282\uFF0C\u4ECE\u5934\u5230\u5C3E\u901A\u8BFB\u4E00\u904D\uFF0C\u7136\u540E\u4E00\u8282\u4E00\u8282\u5730\u56DE\u53BB\u518D\u8BFB\u3002\u5728\u6BCF\u4E2A\u90E8\u5206\u4E4B\u95F4\u505C\u4E0B\u6765\uFF0C\u7EC3\u4E60\u90A3\u4E2A\u90E8\u5206\u7684\u4EE3\u7801\u6216\u601D\u60F3\u3002\u5BF9\u4E8E\u66F4\u5927\u7684\u6982\u5FF5\uFF0C\u66F4\u597D\u7684\u505A\u6CD5\u53EF\u4EE5\u662F\uFF1A\u82B1\u51E0\u5929\u65F6\u95F4\u6765\u6D88\u5316\u3001\u91CD\u8BFB\u3001\u7EC3\u4E60\uFF0C\u7136\u540E\u518D\u6D88\u5316\u3002</p><p>\u4F60\u53EF\u4EE5\u82B1\u4E00\u5230\u4E24\u5468\u7684\u65F6\u95F4\u5728\u6BCF\u4E00\u7AE0\u4E0A\uFF0C\u82B1\u4E00\u5230\u4E24\u4E2A\u6708\u7684\u65F6\u95F4\u5728\u6BCF\u4E00\u672C\u4E66\u4E0A\uFF0C\u82B1\u4E00\u5E74\u6216\u66F4\u957F\u65F6\u95F4\u5728\u6574\u4E2A\u7CFB\u5217\u4E0A\uFF0C\u4F46\u522B\u60F3\u7740\u628A\u6BCF\u4E00\u90E8\u5206\u69A8\u5E72\u3002</p><p>\u4E0D\u8981\u4E00\u4E2A\u52B2\u5730\u72C2\u770B\u8FD9\u4E9B\u4E66\uFF0C\u8010\u5FC3\u70B9\uFF0C\u5206\u6563\u5730\u9605\u8BFB\u3002\u5728\u4F60\u7684\u5DE5\u4F5C\u6216\u53C2\u4E0E\u7684\u9879\u76EE\u4E2D\uFF0C\u5C06\u9605\u8BFB\u4E0E\u5927\u91CF\u7684\u4EE3\u7801\u5B9E\u8DF5\u76F8\u7ED3\u5408\u3002\u79EF\u6781\u5730\u9A8C\u8BC1\u6216\u662F\u8D28\u7591\u6211\u5728\u4E66\u4E2D\u63D0\u51FA\u7684\u89C2\u70B9\u3002\u591A\u4E0E\u522B\u4EBA\u8FA9\u8BBA\uFF0C\u6700\u91CD\u8981\u7684\u662F\uFF0C\u4E0E\u4E0D\u540C\u610F\u6211\u7684\u4EBA\u8FA9\u8BBA\uFF01\u7EC4\u7EC7\u4E00\u4E2A\u5B66\u4E60\u5C0F\u7EC4\u6216\u8BFB\u4E66\u4FF1\u4E50\u90E8\u3002\u5728\u529E\u516C\u5BA4\u4E3E\u529E\u5C0F\u578B\u7814\u8BA8\u4F1A\u3002\u5728\u535A\u5BA2\u4E0A\u5199\u4E0B\u4F60\u6240\u5B66\u5230\u7684\u4E1C\u897F\u3002\u6216\u662F\u5728JavaScript\u5F00\u53D1\u8005\u4EEC\u7684\u805A\u4F1A\u4E0A\u804A\u804A\u8FD9\u4E9B\u8BDD\u9898\u3002</p><p>\u6211\u7684\u76EE\u6807\u4ECE\u6765\u4E0D\u662F\u8BF4\u670D\u4F60\u540C\u610F\u6211\u7684\u89C2\u70B9\uFF0C\u800C\u662F\u9F13\u52B1\u4F60\u62E5\u6709\u5E76\u634D\u536B\u81EA\u5DF1\u7684\u89C2\u70B9\u3002\u4F60\u4E0D\u53EF\u80FD\u628A\u8FD9\u4E9B\u4E66\u4E34\u65F6\u901A\u8BFB\u4E00\u904D\u5C31\u4F7F\u5B83\u5F62\u6210\u3002\u8FD9\u9700\u8981\u5F88\u957F\u65F6\u95F4\uFF0C\u5728\u4F60\u7814\u7A76\u3001\u601D\u8003\u548C\u91CD\u65B0\u5BA1\u89C6\u7684\u8FC7\u7A0B\u4E2D\uFF0C\u5C5E\u4E8E\u4F60\u81EA\u5DF1\u7684\u89C2\u70B9\u624D\u4F1A\u4E00\u70B9\u4E00\u70B9\u5730\u6D6E\u73B0\u51FA\u6765\u3002</p><p>\u8FD9\u4E9B\u4E66\u7684\u76EE\u7684\u662F\u4E3A\u60A8\u7684JavaScript\u5B66\u4E60\u8DEF\u7A0B\u6307\u70B9\u8FF7\u6D25\uFF0C\u4ECE\u4F60\u73B0\u5728\u5BF9\u8FD9\u95E8\u8BED\u8A00\u7684\u7406\u89E3\u7A0B\u5EA6\uFF0C\u5230\u4E00\u4E2A\u66F4\u6DF1\u5C42\u6B21\u7684\u7406\u89E3\u7A0B\u5EA6\u3002\u4F60\u5BF9JavaScript\u7684\u7406\u89E3\u8D8A\u6DF1\uFF0C\u4F60\u5C31\u4F1A\u95EE\u8D8A\u591A\u7684\u95EE\u9898\uFF0C\u4F60\u5C31\u4F1A\u63A2\u7D22\u5230\u8D8A\u591A\uFF01\u8FD9\u5C31\u662F\u6211\u89C9\u5F97\u4EE4\u4EBA\u5174\u594B\u7684\u5730\u65B9\uFF01</p><p>\u6211\u5F88\u9AD8\u5174\u4F60\u8E0F\u4E0A\u4E86\u8FD9\u6BB5\u65C5\u7A0B\uFF0C\u6211\u4E5F\u5F88\u8363\u5E78\u4F60\u80FD\u5728\u65C5\u9014\u4E2D\u601D\u8003\u5E76\u67E5\u9605\u8FD9\u4E9B\u4E66\u3002\u90A3\u4E48\uFF0C\u8BF4\u4E86\u90A3\u4E48\u591A\uFF0C\u662F\u65F6\u5019\u5F00\u59CB\u4E86\u89E3JavaScript\u4E86\u3002</p>',42);function c(i,e){return t}var n=p(r,[["render",c]]);export{n as default};
